literals:
"
  <style>
    *, *:before, *:after {
      box-sizing: border-box;
    }
    :host {
      display: inline-block;
      overflow-x: hidden;
    }
    :host([hidden]) {
      display: none;
    }
    #wrapper {
      position: relative;
      display: flex;
      flex-direction: row;
      align-items: center;
      white-space: nowrap;
      margin: 0;
      padding: 0;
      border-width: 0;
      cursor: default;
    }
    .itemcont {
      border-width: 0;
      margin: 0;
      padding: 0;
    }
    .item {
      border-width: 0;
      margin: 0;
      padding: 0;
      display: flex;
      user-select: none;
    }
    .itemnoimg {
      padding: 0.3em 1em 0.4em 1em;
      flex-direction: column;
    }
    .itemimg {
      padding: 0.2em 0.8em 0.2em 1.1em;
      display: flex;
      flex-direction: row;
      align-items: center;
    }
    .item-text {
      margin: 0;
      padding: 0 0 0 0.7em;
      border-width: 0;
    }
    .item-img-div {
      display: flex;
      margin: 0;
      padding: 0.25em 0.8em 0.25em 0;
      border-width: 0;
    }
    .item-img {
      margin: auto;
      max-height: 100%;
      padding: 0;
      border-width: 0;
    }
    .item-title {
      font-size: 112%;
      line-height: 1.7;
      margin: 0;
      padding: 0 0 0 0.15em;
      border-width: 0;
    }
    .item-date {
      font-size: 97%;
      line-height: 1.3;
      margin: 0 0.2em 0 0.3em;
      padding: 0;
      border-width: 0;
    }
  </style>
"
